'use strict';
let list = require('@gehtsoft/LuaxStdlib-node').list;
class CompositeSubscriptionRequest {
    requests;
    isCompleted() {
        let i, result;
        result = true;
        for (i = 0; i <= this.requests.length() - 1; i += 1) {
            result = result && this.requests.get(i).isCompleted();
        }
        return result;
    }
    addRequest(request) {
        this.requests.add(request);
    }
    getRequest(index) {
        return this.requests.get(index);
    }
    length() {
        return this.requests.length();
    }
    static create() {
        let result;
        result = new CompositeSubscriptionRequest();
        result.requests = new list();
        return result;
    }
}
module.exports = CompositeSubscriptionRequest
